INSERT INTO `factory_recruit` VALUES ('1', '1', '2', '21', '21', '12', '12', '12', '2', '21', '21', '北京市', '市辖区', '2121', '东城区', '21', '12', '13265545545', '121', '12', '21', '4', '115', '/static/uploadajax/154511429890252.png', '<div class=\"fac_main_info\"><div class=\"fac_salary\"><div class=\"fac_title\"><em class=\"lines\"></em><em class=\"ic ic_fac_t1\"></em><h3>工资情况</h3></div><h3 class=\"title2\"><em class=\"line\"></em>我能挣多少钱？</h3><table width=\"100%\"><tbody><tr class=\"t1 first\"><th><em class=\"ic ic_gz_zh\"></em>综合工资</th><td><span class=\"prices\">￥4500-6000 元/月</span></td></tr><tr class=\"t1\"><th><em class=\"ic ic_gz_xs\"></em>小时工</th><td><span class=\"prices\">22元/小时</span><span class=\"notes\"></span><span class=\"fr\">月工资：<em class=\"prices\">4500-6000元</em></span></td></tr><tr class=\"t1\"><th><em class=\"ic ic_gz_ff\"></em>发放时间</th><td>每月20日准时打入工资卡。</td></tr></tbody></table></div><div class=\"fac_des\"><div class=\"fac_title\"><em class=\"lines\"></em><em class=\"ic ic_fac_t2\"></em><h3>岗位介绍</h3></div><ul class=\" list-paddingleft-2\"><li><h3 class=\"title2\"><em class=\"line\"></em>需要什么条件？</h3></li><li><p>1、16-45岁，男女不限；<br/>2、手背上有纹身、不夸张性小纹身烟疤也可以，体重不超过190斤，男生头发颜色不能太夸张；<br/>3、认识26个英文字母；<br/>4、自离或正常离职满1个月可以再进厂； <br/>5、有效二代身份证原件（身份证无磁及临时身份证均可）及身份证复印件2张，一寸照片2张，黑色水笔1支。</p></li><li><h3 class=\"title2\"><em class=\"line\"></em>上班情况？</h3></li><li><p>工作内容：<br/>主要生产车载耳机，音响，电话手表。<br/>工作时间：<br/>两班制（半个月倒班一次），早班7:00-19:00，晚班19:00-7:00。<br/>工作方式：<br/>1、两班制（半个月倒班一次），早班7:00-19:00，晚班19:00-7:00；<br/>2、工作方式坐站都有，不穿无尘服。<br/></p></li><li><h3 class=\"title2\"><em class=\"line\"></em>吃住咋样？</h3></li><li><p>伙食情况：<br/>伙食为自己充卡吃饭。<br/>宿舍情况：<br/>厂内免费住宿，宿舍有独立洗手间，公共卫浴设施。<br/>工厂情况：<br/>1、厂区环境优美，厂内设有餐厅、篮球场等等生活娱乐设施。<br/>2、厂区周边分布有佳境天城、北海公寓等，房子距离厂区很近，骑电动车5-8分钟，一般十几平米的房子租金在300-500元/月左右。<br/></p></li><li><h3 class=\"title2\"><em class=\"line\"></em>有啥福利？</h3></li><li><p>社会保险：<br/>不扣社保。<br/></p></li></ul><div class=\"fac_des_note\"><span class=\"titles\"><em class=\"ic ic_fac_desnote\"></em>温馨提示：</span><p><br/></p><p class=\"vals\">1、进厂面试请注意排队；</p><p class=\"vals\">2、培训的时候不能穿拖鞋；</p><p class=\"vals\">3、可提前申请安排到同一厂区；</p><p class=\"vals\">4、员工面试时间为8:00- 17:00。</p></div></div></div>', '<h2 class=\"f_title scroll_title\"><span class=\"ic_line ic_line_l\"></span><em class=\"icon2 icon2-xinzifuli\"></em>工资情况<span class=\"ic_line ic_line_r\"></span></h2><div class=\"page_hcon page_hinfo\"><div class=\"h_title\"><h2><em class=\"ic_line\"></em>我能挣多少钱？</h2></div><ul class=\"price_table list-paddingleft-2\"><li><p>综合工资：</p></li><li><p><em>4500-5500元/月</em></p></li><li><p>底薪描述：</p></li><li><p>底薪2020元/月。</p></li><li><p>加&nbsp;&nbsp;班&nbsp;&nbsp;费：</p></li><li><p>加班翻倍。</p></li><li><p>发放时间：</p></li><li><p>每月8号准时打入工资卡。</p></li></ul></div><h2 class=\"f_title scroll_title\"><span class=\"ic_line ic_line_l\"></span><em class=\"icon2 icon2-gangweijieshao\"></em>岗位介绍<span class=\"ic_line ic_line_r\"></span></h2><div class=\"page_hcon page_hinfo\"><div class=\"h_title\"><h2><em class=\"ic_line\"></em>需要什么条件？</h2></div><ol class=\" list-paddingleft-2\"><li><p><span class=\"nums\">1、</span>18-40周岁，男女不限；</p></li><li><p><span class=\"nums\">2、</span>认识26个英文字母；</p></li><li><p><span class=\"nums\">3、</span>身体健康，无纹身烟疤，体内不能有金属物质，手指灵活 （ 手指残缺、有明显伤疤需要提前确认，不脱上衣检查）；</p></li><li><p><span class=\"nums\">4、</span>男女身高不得低于145cm，轻微色弱可以进厂；</p></li><li><p><span class=\"nums\">5、</span>自离或者正常辞职满48个工作日，才能再进工厂；</p></li></ol></div><div class=\"page_hcon page_hinfo\"><div class=\"h_title\"><h2><em class=\"ic_line\"></em>上班情况？</h2></div><ul class=\" list-paddingleft-2\"><li><p>工作内容：</p></li><li><p>1、主要生产手机电脑、组装、包装等；\r\n2、工作环境良好，恒温、恒湿无尘车间。</p></li><li><p>工作时间：</p></li><li><p>两班倒，根据车间不同上班时间不同，一个月倒一次班。</p></li><li><p>工作方式：</p></li><li><p>工作方式以坐着上班为主，工作需穿静电服。</p></li></ul></div><div class=\"page_hcon page_hinfo\"><div class=\"h_title\"><h2><em class=\"ic_line\"></em>吃住咋样？</h2></div><ul class=\" list-paddingleft-2\"><li><p>伙食情况：</p></li><li><p>公司为大家提供餐费补助280元/月。</p></li><li><p>住宿情况：</p></li><li><p>1、目前有三个住宿区域；\r\n2、宿舍8人间（住宿30元/月），宿舍有空调、洗衣机、无线网、标准八人间、独立卫生间、独立卫浴，住宿环境干净舒适；\r\n3、去厂里可以走路也可以做厂车，走路20分钟到厂，坐厂车5-8分钟左右到厂。</p></li><li><p>工厂环境：</p></li><li><p>1、员工生活区内设有医务室、中国移动、水果店、超市、小吃街、图书馆、网吧等社会配套服务机构；公司内部有足球、篮球场等；</p></li></ul></div><div class=\"page_hcon page_hinfo\"><div class=\"h_title\"><h2><em class=\"ic_line\"></em>有啥福利？</h2></div><ul class=\" list-paddingleft-2\"><li><p>福利待遇：</p></li><li><p>1、优秀员工旅游：每月表现优秀的员工，会有机会被安排至上海/苏州/无锡/杭州/周庄等旅游景点免费旅游一次；<br/>2、班组长培训：每月会从在职产线员工中选拔表现优异者参加培训，作为基层主管的储备； <br/>3、年终奖金：这个根据个人年度绩效情况，在年末时会发放不同金额的年终奖金； <br/>4、年度优秀员工：公司每年度都会评选全公司优秀员工，并发放给每名1000元的激励奖金及奖牌。</p></li><li><p>社会保险：</p></li><li><p>交社保212元/月。</p></li><li><p>休息节日：</p></li><li><p>正常是一个月休息4天。</p></li></ul></div><div class=\"page_hcon page_hinfo\"><div class=\"h_title\"><h2><em class=\"ic_line\"></em>温馨提示</h2></div><ul class=\"note_table list-paddingleft-2\"><li><ul class=\" list-paddingleft-2\"><li><p><span class=\"nums\">1、</span>进厂需要带上有效二代身份证原件及身份证复印件5张，毕业证复印件2张，一寸或者二寸照片3张，黑色水笔1支；</p></li><li><p><span class=\"nums\">2、</span>报道迟到的最低一星期以后可以再去，报道后分到产线迟到的最低一个月以后可以再进；</p></li><li><p><span class=\"nums\">3、</span>自离或者正常辞职满48个工作日，就能再进工厂工作；</p></li><li><p><span class=\"nums\">4、</span>有夫妻想在一个车间上班的，可以找驻厂老师报备。</p></li></ul></li></ul></div>', '1', '1545114300', '1545114300', '1', '0', '0');
