-- Table structure for `factory_article_generate`
-- ----------------------------
DROP TABLE IF EXISTS `factory_article_generate`;
CREATE TABLE `factory_article_generate` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(250) NOT NULL,
  `content` text NOT NULL,
  `create_time` int(11) NOT NULL,
  `update_time` int(11) NOT NULL,
  `admin_id` int(11) NOT NULL,
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '0表示没有发布1发布成功',
  `article_cate` varchar(50) NOT NULL DEFAULT '0' COMMENT '发布远程文章的分类',
  `keywords` varchar(250) NOT NULL COMMENT '关键字',
