  `thumb` varchar(150) NOT NULL COMMENT '缩昵图地址',
  `urlpc` varchar(150) NOT NULL DEFAULT '未发布' COMMENT '电脑端文章发布后的url地址',
  `urlm` varchar(150) NOT NULL DEFAULT '未发布' COMMENT '手机端发布后的url地址',
  `shoulum` int(1) NOT NULL DEFAULT '0' COMMENT '手机收录 0否1是',
  `shoulu` int(1) NOT NULL DEFAULT '0' COMMENT '0表示未收录1表示收录',
  `timetask` int(11) NOT NULL DEFAULT '1232553600' COMMENT '定时任务的时间戳',
  `apiurl` varchar(150) NOT NULL DEFAULT '0' COMMENT '远程文章发布地址',
  `edit_admin_id` varchar(150) NOT NULL DEFAULT '0' COMMENT '修改文章的管理员',
  `is_task` int(1) NOT NULL DEFAULT '0' COMMENT '0是未发布1是即时任务2是定时任务',
  `article_push` int(1) NOT NULL DEFAULT '0' COMMENT '文章推送成功没有0失败1成功',
  `createxml` int(1) NOT NULL DEFAULT '0' COMMENT '写入xml网站地图成功没有',
  `checknumbers` int(11) NOT NULL DEFAULT '0' COMMENT '查询收录的总次数 超过100不在查询',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

